We are all missing our dear friend #AnthonyBourdain. In 2018, Tony and @LaurieWoolever, his longtime collaborator, began working on an extensive travel guide featuring Tony’s passion to explore cuisine and cultures all over the world. While we may not be able to travel right now, #LaurieWoolever has given us the gift to read and eat like #Bourdain with “World Travel: An Irreverent Guide.” I know Tony would be very proud of Laurie for finishing what they started. Thank you for sharing all of the intimate stories and food adventures in his voice, this will be something his friends, family and fans will cherish forever. 
 
